import React, { useRef, useState, useMemo } from "react";

let useMemoexam = () => {

    
    const [counter, setcounter] = useState(0)
    const [test, settest] = useState()

    let incre = () => {setcounter(counter + 1)}

    let decre = () => {setcounter(counter - 1)}
    
    let pranteNumber = () => {
     
     settest(test = counter)


    }

    let resulte = useMemo(() => {
        return (
            <div style={{color: randomecolors }}>
            value is {counter} : = {counter * 2}
        </div>
        )
    }, [counter])

    return (
        <div>
            {resulte}

            <span>
                value: {test}
            </span>
            <button  onClick={()=> incre}>-</button>
            <button  onClick={() => decre}>+</button>
            <button onClick={()=> pranteNumber}>test</button>
        </div>
    )
}

export default useMemoexam
